    const { getIssues, state, currentUser, history } = props
    return (
        <div>
            <form >
                Name
                <input type="text" name="name" />
                Type
                <input type="text" name="type" />
                <button>Click this</button>
            </form>
        </div>
    )
}

const mapStateToProps = (state) => {
    return { state: state.issues }
}

export default Main
